import React from 'react';
import { useNavigate } from 'react-router-dom';
import { PersonFill, PersonPlusFill } from 'react-bootstrap-icons'; // Importe os ícones necessários
import styles from './Home.module.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.container}>
      <div className={styles.box}>
        <h1 className={`${styles.title} mb-4 text-center`}>Portal do Funcionário</h1>
        <div className="d-flex flex-column align-items-center gap-2 w-100">
          <button className="btn btn-primary w-100 max-w-300" onClick={() => navigate('/Login')}>
            <PersonFill className="me-2" /> Entrar {/* Ícone de pessoa com margem à direita */}
          </button>
          <button className="btn btn-secondary w-100 max-w-300" onClick={() => navigate('/Cadastrar')}>
            <PersonPlusFill className="me-2" /> Cadastrar {/* Ícone de pessoa com sinal de mais e margem à direita */}
          </button>
        </div>
        <p className={styles.rodape}>Desenvolvido por Leonardo Dias</p>
      </div>
    </div>
  );
};

export default Home;
